import React from 'react';
import './Nav.css'

function Nav(props) {
    return (
        <div className ='nav'>
            <h2>Simple cocktail</h2>
            <h2>Cool Cocktail</h2>
            <h2>Milk/ Shake/ Float</h2>
            <h2>Cocoa</h2>
            <h2>Shot</h2>
            <h2>Coffee/ Tea</h2>
            <h2>Home-made Liqueur</h2>
            <h2>Party Drink cocktail</h2>
            <h2>Beer cocktail</h2>
            <h2>Soft Drink/ Soda</h2>
        </div>
    );
}

export default Nav;
